import React from 'react';
import styled from 'styled-components'

const Main = props => {
    return (
        <HEADER>
            HEAD
        </HEADER>
    )
}

export default Main

const HEADER = styled.div`
    display: flex;
    flex-direction: column;
    background-color: purple;
`
